import '../App.css';

function Navbar(){
    return(
        <header>
            <div className="NavBarBox">
            <li>
                <ul><i></i></ul>
                <ul><a href="../public/index.html" className="NavBarText">Home</a></ul>
                <ul><a href="../public/About.html" className="NavBarText">About</a></ul>
                <ul><a href="../public/About.html" className="NavBarText">Blogs</a></ul>
                <ul><a href="../public/About.html" className="NavBarText">Q 'n' A</a></ul>
                <ul><a href="../public/About.html" className="NavBarText">Login</a></ul>
            </li>
            </div>
        </header>
    );
}

export default Navbar;
